import './Editor.css'

function Toolbar_button () {
    return (
        <>
            <button type='button' className='Toolbar_button'></button>
        </>
    )
}

function Toolbar () {
    return (
        <>
        <div className='Toolbar'>
            <Toolbar_button />
        </div>
        </>
    )
}

function Editor () {
    return (
        <>
        <div>
            <Toolbar />
        </div>
        </>
    )
}


export default function Page () {
    return (
      <>
        <div>
          <Editor />
        </div>
      </>
    );
  }
